// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getDatabase, ref, set } from "firebase/database";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyCAw8-DhNSEAzFdK1woKhA0bLuYR101y-E",
  authDomain: "los-hornos.firebaseapp.com",
  databaseURL: "https://los-hornos-default-rtdb.firebaseio.com",
  projectId: "los-hornos",
  storageBucket: "los-hornos.appspot.com",
  messagingSenderId: "889990826002",
  appId: "1:889990826002:web:b1b02a0f7e4edeaa78b0cb"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

const db = getDatabase(app);

export default db;
